import { Pipe, PipeTransform } from '@angular/core';

export enum LabelOfSnapshot {
  Update = 'update',
  Hidden = 'hidden',
  New = 'new',
  NoLabel = 'no-label'
}

const enumStrNameOfLabel = {
  [LabelOfSnapshot.Update]: { text: 'Update', colorClass: 'text-brave-magenta' },
  [LabelOfSnapshot.Hidden]: { text: 'Hidden', colorClass: 'text-lt-gray' },
  [LabelOfSnapshot.New]: { text: 'New', colorClass: 'text-brave-blurple' },
  [LabelOfSnapshot.NoLabel]: { text: '', colorClass: '' }
};

@Pipe({
  name: 'snapshotLabel'
})
export class SnapshotLabelPipe implements PipeTransform {
  transform(value: any, ...args: any[]): string {
    let result = '';
    const typeOfOutput: 'color-class' | 'text' | undefined = args[0];
    if (typeOfOutput !== undefined) {
      const labelValue = enumStrNameOfLabel[value as LabelOfSnapshot];
      result = typeOfOutput === 'text' ? labelValue.text : labelValue.colorClass;
    }
    return result;
  }
}

import { Pipe, PipeTransform } from '@angular/core';
import { SnapshotStatus } from './snapshot-display-card.component';

const enumStrColorCLassIndicator = {
  [SnapshotStatus.Danger]: 'brave-danger',
  [SnapshotStatus.Safe]: 'brave-safe',
  [SnapshotStatus.Critical]: 'brave-critical',
  [SnapshotStatus.Default]: 'lt-gray'
};

@Pipe({
  name: 'snapshotStatus'
})
export class SnapshotStatusPipe implements PipeTransform {
  transform(value: string, ...args: any[]): string {
    let result = '';

    const outputStyle = args[0];
    if (outerHeight !== undefined) {
      const prefix = outputStyle === 'text' ? 'text-' : 'bg-';
      result = prefix + enumStrColorCLassIndicator[value as SnapshotStatus];
      if (outputStyle === 'text') {
        result += ' text-3.5';
      }
    }
    return result;
  }
}

