import { Component, EventEmitter, Input, OnInit, Output } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import {
  ITransunionKBAAnswer,
  ITransunionKBAQuestion,
} from '@shared/interfaces/tu-kba-questions.interface';

export interface IKbaMultipleChoiceConfig {
  size: string;
  label: string;
  type: string;
  placeholder: string;
  autocomplete: string;
  value?: string;
}

@Component({
  selector: 'brave-kba-multiplechoice-input',
  templateUrl: './kba-multiplechoice-input.component.html',
})
export class KbaMultiplechoiceInputComponent implements OnInit {
  private _required: boolean = false;
  private _asteriskOverride: boolean = false;
  private _question: ITransunionKBAQuestion | undefined;

  /**
   * @param Config Object to pass in component params
   * @param config.size 'sm', 'base', 'lg'
   * @param config.label Label text (default: 'Input label')
   * @param config.placeholder Placeholder text (default: 'Input text')
   * @param config.autocomplete Any HTML Input autocomplete value
   * @param config.value (optional) Pre-load the input with a value
   */
  @Input() config: IKbaMultipleChoiceConfig = {
    size: 'base',
    label: 'Input label',
    type: 'text',
    placeholder: 'Input text',
    autocomplete: 'off',
    value: '',
  };

  /**
   * @input Flag to make the input field required for form to be valid
   */
  @Input()
  get required() {
    return this._required;
  }
  set required(value: any) {
    this._required = !!value;
  }

  /**
   * @input Flag to override the display of an asterisk but still make it required
   */
  @Input()
  get asteriskOverride() {
    return this._asteriskOverride;
  }
  set asteriskOverride(value: any) {
    this._asteriskOverride = !!value;
  }

  /**
   * {@input (ITransunionKBAQuestion) Individual question
   */
  @Input()
  get question() {
    return this._question;
  }
  set question(value: ITransunionKBAQuestion | undefined) {
    this._question = value;
  }

  get choices() {
    const choices:
      | ITransunionKBAAnswer
      | ITransunionKBAAnswer[]
      | undefined = this._question?.AnswerChoice;
    if (!choices) {
      return [];
    }
    return choices instanceof Array ? choices : [choices];
  }

  @Output() valueChanged: EventEmitter<any> = new EventEmitter();
  @Output()
  onComponentReady: EventEmitter<FormGroup> = new EventEmitter<FormGroup>();

  public componentFormGroup: FormGroup = new FormBuilder().group({
    input: [''],
  });
  public locked: boolean = false;
  public hidden: boolean = false;

  constructor(private fb: FormBuilder) {}

  ngOnInit(): void {
    const validators = [];
    if (this.required) {
      validators.push(Validators.required);
    }
    this.componentFormGroup = this.fb.group({
      input: [this.config.value, validators],
    });
    this.componentFormGroup.controls.input.valueChanges.subscribe((value) =>
      this.valueChanged.emit(value)
    );
    this.onComponentReady.emit(this.componentFormGroup);
  }
}

import {
  AfterViewInit,
  Component,
  ElementRef,
  EventEmitter,
  Input,
  Output,
  Renderer2,
  ViewChild,
} from '@angular/core';
import { FormBuilder } from '@angular/forms';
import { BaseFormComponent } from '@shared/components/forms/base-form/base-form.component';
import { IKbaMultipleChoiceConfig } from '@shared/components/inputs/kba-multiplechoice-input/kba-multiplechoice-input.component';
import { ITransunionKBAQuestion } from '@shared/interfaces/tu-kba-questions.interface';

@Component({
  selector: 'brave-kbaquestions-form',
  templateUrl: './kbaquestions-form.component.html',
  providers: [{ provide: 'name', useValue: 'kba-form' }],
})
export class KbaquestionsFormComponent
  extends BaseFormComponent
  implements AfterViewInit {
  @ViewChild('slider') slider!: ElementRef;
  @ViewChild('sliderWindow') sliderWindow!: ElementRef;

  @Input() kbas: ITransunionKBAQuestion[] = [];
  @Output()
  clickAnswer: EventEmitter<ITransunionKBAQuestion> = new EventEmitter();

  sliderWidth: number = 1200;
  itemWidth: number = 300;
  carouselXAxis: number = 0;
  tracker: any[] = [0];

  public kbaConfig: IKbaMultipleChoiceConfig = {
    size: 'sm',
    type: 'text',
    label: '',
    placeholder: '',
    autocomplete: 'off',
  };

  constructor(fb: FormBuilder, private renderer: Renderer2) {
    super(fb, 'kba-form');
  }

  ngAfterViewInit(): void {
    this.setSliderWindowWidth(this.itemWidth);
    this.setSliderWidth(this.sliderWidth);
  }

  formatChildName(childName: string, digit: number): string {
    return `${childName}-${digit}`;
  }

  /**
   * Sets the slider window width so only a portion is showing
   * @param width
   */
  setSliderWindowWidth(width: number): void {
    // TODO need to set floor to width of containing elements
    this.renderer.setStyle(
      this.sliderWindow.nativeElement,
      'width',
      `${width}px`
    );
  }

  /**
   * Sets the slider width to hold all the items
   * @param width
   */
  setSliderWidth(width: number): void {
    // TODO need to set floor to width of containing elements x 3
    this.renderer.setStyle(this.slider.nativeElement, 'width', `${width}px`);
  }

  /**
   * Method to scroll the carousel by a percentage value
   * @param value percentage to move the carousel over by
   * @param min the floor that the scroll should go to (i.e. 0)
   * @param max the max translation the scrill should go to (e.g. -75...if 4 items)
   */
  scroll(value: number, min: number, max: number): void {
    if (this.carouselXAxis + value > min || this.carouselXAxis + value < max) {
      return;
    }
    // pop and push tracker to know which question we are on
    if (value < 0) {
      this.tracker = [...this.tracker, 0];
    }
    if (value > 0) {
      this.tracker = [...this.tracker.slice(1)];
    }

    this.carouselXAxis += value;
    this.renderer.setStyle(
      this.slider.nativeElement,
      'transform',
      `translateX(${this.carouselXAxis}%)`
    );
  }
}

